import '../Barra/barra.css'

function Barra () {
    return (
    <div className="painel_minimizado">
		
        <img className="imagem_usuario_minimizado" src="imagem_perfil_exemplo.jpg" />
    
        <div className="triangulo"></div>
        
    </div>
    )
}
export default Barra;
